import React from 'react'; 
import './App.css';

import Home from './components/Home.js'


function App () {
  return(
    <BrowserRouter>
          <Switch>
            <Route exact path="/" render={() => <Home />} />
          </Switch>
    </BrowserRouter> 

  );
}


export default App;
